import React, { useState } from 'react';
import Select from '../../Select';


function FilterHistoric(props) {

    const [statusDuel, setStatusDuel] = useState(props.status);
    console.log(statusDuel)

    let options = [{
        todos: 'Todos',
        finalizados: 'Finalizados',
        apuracao: 'Em apuração'    
    }]

    let optionsStatus = options.map(elemento => elemento.status)
    let selected =  optionsStatus.filter(elemento => elemento.status == statusDuel) ; 

    function changeStatusDuel(s) {  
        setStatusDuel(s)
        props.setFilter(s)
    }

    return (
        <div className="containerFilter">
            <div className="containerSelects">
                <div className="containerSelect">
                    <Select
                        onChange={changeStatusDuel}
                        width={'150px'}
                        placeholder={statusDuel ? statusDuel : "Status"}
                        options={optionsStatus}
                        classNames={'select-class'}
                        name="statusDuel"
                    />
                </div>
            </div>
        </div>
    )
}

export default FilterHistoric;
